import { useState } from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
import KakaoLoginButtin from "../components/logonKakao";

const Wrapper = styled.div`
    display: flex;
    justify-content: center;
    height: 100vh;
    align-items: center;
`;
const Title = styled.h1`
    font-size: 40px;
    font-weight: 800;
    margin-bottom: 20px;
    color:#e37676;
`
const P = styled.p`
    margin-bottom: 25px;
`
const Form = styled.form`
    flex-direction: column;
    width: 500px;
    justify-content: center;
    align-items: center;
    display: flex;
    padding: 50px 10px;
    border: 1px solid #e37676;
    border-radius: 10px;
`;
const Input = styled.input`
    width: 400px;
    padding: 10px;
    margin: 10px;
    border: none;
    border-radius: 5px;
    font-size: 17px;
    &[name="id"]{

    }
    &[type="submit"]{
        width: 420px;
        font-weight: 600;
        background-color: #e37676;
        color: white;
        &:hover{
            opacity: 0.92;
        }
    }
`;
const Swither = styled.p`
    margin-top: 5px;
`
const createAccountStyle = {
    textDecoration: "none",
    color:"#00acee"
}
export default function Login(){
    const [id, setId] = useState("");
    const [password, setPassword] = useState("");
    const [logins, setLogins] = useState(true);

    return(
        <Wrapper>
            <Form>
                <Title>UNTITY 2</Title>
                <P>레전드 일베충들의 두번째 시즌</P>
                <Input type="text" placeholder="ID" name="id"  required/>
                <Input type="password" placeholder="PW" name="password"  required/>
                <Input type="submit" value="LOGIN"/>
                <Swither>아직 계정이 없으신가요?.  <Link style={createAccountStyle} to="/create-account">계정 만들기 &rarr;</Link></Swither>
                <KakaoLoginButtin/>
            </Form>
        </Wrapper>
    );
}
